import { requestWithCallbackId } from './request.js';
export function openUrl(url) {
    window.webkit.messageHandlers.openUrl.postMessage(url);
}
export function openCosmoUrl(path) {
    window.webkit.messageHandlers.openCosmoUrl.postMessage(path);
}
export async function getCosmoUrl(path) {
    return requestWithCallbackId('getCosmoUrl', { path });
}
